  true,\n\t\"url\": null,\n\t\"notes\": \"The filers in the table below have not paid
  one or more late filing fees.  The filers listed below have not responded to two
  or more written notices and one or more verbal notices regarding late filing fees.
  \ Filers posted to this list for not paying late filing fees are removed from this
  list after paying their late fees or four (4) years have elapsed since the Executive
  Director's final determination of the late fees (i.e., the date the late fees are
  assessed or the date the Executive Director makes a determination in response to
  a request for waiver, if any).In addition to being listed in the table below, filers
  whose late fees remain unpaid may be referred to the Bureau of Delinquent Revenues
  at the Treasurer and Tax Collectors Office.\",\n\t\"owner_org\": \"e370c484-cc05-4509-919a-5600f8d56a48\",\n\t\"extras\":
